import React from "react";
import {Route, Switch} from "react-router-dom";
import Error from "./Error";
import CreateNote from "./CreateNote";
import Note from "./Note";
import User from "./User";
import Menu from "./Menu";

const Home = () =>{
    
    return(
        <>
        <div className="header">
            <div className="box_center"> <Menu/></div>
        </div>
        <div>
            <Switch>
                <Route exact path="/" component={()=> <Error name="Welcome to Our Website" />} />
                <Route exact path="/creatnote" component={CreateNote}/>
                <Route exact path="/note" component={Note}/>
                <Route exact path="/render" render={()=> <Error render="Render Page" />}/>
                <Route exact path="/user/:fname/:lname" component={User}/>
                <Route render={()=> <Error errmsg="Opps! Page Note Found ðŸ˜²"/>}/>
            </Switch>
        </div>
    </>
    );
}
export default Home;
